import './App.css'
import React, { useState, useEffect } from 'react'
import WebFont from 'webfontloader'
import './App.css'
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom'


function Victory(props) {
    const [createRoom, setCreateRoom] = useState(false);
    useEffect(() => {
      WebFont.load({
        google: {
          families: ['Abril Fatface', 'GFS Didot', 'Antic Didone'],
        },
      })
    }, [])

    const roomCreation = () => {
      setCreateRoom(!createRoom)
    }

    return (
      <div>
        <p className="title" style={{ fontFamily: 'Abril Fatface' }}>
        You Win!
      </p>
      <p className="subtitle" style={{ fontFamily: 'Abril Fatface' }}>
        {props.time}s
      </p>
      <br />
      {/* <h3>Top Scores for this Song</h3> */}
      <ol>
        <li>Amy: 12.9s</li>
        <li>Marta: 50.5s</li>
      </ol>
      <br />
      <div>
          <Link to="/lobby">
            <button className="join" onClick={() => roomCreation()}>
              Create a Room
            </button>
          </Link>
          <Link to="/lobby">
            <button className="join">Join a Room</button>
          </Link>
        </div>
      </div>
    )
  }
  
  export default Victory
